                    1686.3758936906233
                ],
                [
                    4043.207161566359,
                    1695.7795214793878
                ],
                [
                    4037.4082859242335,
                    1703.8656744519249
                ],
                [
                    4028.710882255502,
                    1708.499546969353
                ],
                [
                    4019.0360512891784,
                    1706.8780510062352
                ],
                [
                    4011.610897362232,
                    1700.2869899868965
                ],
                [
                    4006.7539197568203,
                    1691.5801333414074
                ]
            ]
        ]

        const map = (v, a1, a2, b1, b2) => {
            return ((v - a1) / (a2 - a1)) * (b2 - b1) + b1;
        }

        window.addEventListener('load', () => {
            context.fillStyle = '#000';
            context.fillRect(0, 0, canvas.width, canvas.height);
            let minX = Infinity, maxX = -Infinity;
            let minY = Infinity, maxY = -Infinity;
            for (let i = 0; i < paths.length; i++) {
                for (let j = 0; j < paths[i].length; j++) {
                    minX = Math.min(minX, paths[i][j][0]);
                    minY = Math.min(minY, paths[i][j][1]);

                    maxX = Math.max(maxX, paths[i][j][0]);
                    maxY = Math.max(maxY, paths[i][j][1]);
                }
            }

            context.fillStyle = '#fff';
            context.strokeStyle = '#fff';
            context.lineWidth = 1;
            for (let i = 0; i < paths.length; i++) {
                context.beginPath();
                for (let j = 0; j < paths[i].length; j++) {
                    let x = map(paths[i][j][0], minX, maxX, 0, 1024);
                    let y = map(paths[i][j][1], minY, maxY, 1024, 0);
                    if (j == 0) context.moveTo(x, y);
                    else context.lineTo(x, y);
                }
                context.closePath();
                context.stroke();
                context.fill();
            }
        });

        window.addEventListener('click', () => {
            let text = paths.map(path => path.map(points => points.join(', ')).join('\n')).join('\n\n');
            navigator.clipboard.writeText(text);
        })
    </script>
